    overview:"AWohifno",
    title:"Scooby doo!"
}

function MovieList() {
    const [movies, setMovies] = useState(movieOne)

    return(
        <div className="movie-list">
            <button onClick={()=> setMovies(movies == movieOne ? movieTwo:movieOne)}>
                <h1>Поменять</h1>
            </button>
            <MovieItem data={movies} />
            <MovieItem data={movies} />
            <MovieItem data={movies} />
            <MovieItem data={movies} />
            <MovieItem data={movies} />
            
        </div>
    )
}

export default MovieList;
